import React from 'react';

const Analytics = () => {
  return (
    <div className="p-6 bg-white dark:bg-gray-800 rounded-lg shadow-md">
      <h1 className="text-2xl font-bold mb-4 text-gray-900 dark:text-white">Analytics</h1>
      <p className="text-gray-700 dark:text-gray-300">This is the Analytics page. Delivery statistics and charts will be displayed here.</p>
      {/* Placeholder for future analytics charts and data */}
    </div>
  );
};

export default Analytics;
